        % Con alinealidades
        figure %[output:40f9261d] %[output:4f92d2f5] %[output:47866ad4] %[output:97d5c02f] %[output:698bf026] %[output:8027dd66]
        sgtitle("Consigna " + entradas(i) + " m/s, carga de " + perturbaciones_names(j) + " - Con alinealidades") %[output:40f9261d] %[output:4f92d2f5] %[output:47866ad4] %[output:97d5c02f] %[output:698bf026] %[output:8027dd66]
        subplot(1, 2, 1)
        hold on
        stairs(eje_tiempos_fase5, errores_CA_f5 (:, 3*(i - 1) + j))
        stairs(eje_tiempos_fase5, salidas_CA_f5 (:, 3*(i - 1) + j))
        legend("error [m/s]", "salida [m/s]", Location="east")
        xlabel("tiempo (s)")
        ylabel("[m/s]")
        subplot(1, 2, 2)
